('tr', '_template', 'atutor_is', '<strong><em>ATutor</em></strong> Açık kaynak kodlu <strong>Öğrenme İçerikleri Yönetim Sistemi (ÖİYS)</strong>dir. Erişebilirlik ve uyumluluk özellikleriyle dizayn edilmiştir.Yöneticiler ATutor&#8217;u yükleyebilir veya güncelleştirebilirler. Eğiticiler paketleri kolayca toplayabilir, eğitsel içerikleri yeniden dağıtabilir, derslerini çevrimiçi olarak yönetebilirler. Öğrenciler bir  adapte edici bir öğrenme çevresinde öğrenebilirler.', '2005-07-30 12:03:37', ''),
